            <li> <a href="https://www.linkedin.com/in/paulo-de-lacerda-oliveira-552677b7/" target="_blank">  LinkedIn</a></li>
            <li> <a href="https://github.com/paulooliveira152012" target="_blank">  Github</a></li>

          </ul>
      </section>
    )
}


